import React, { useState } from 'react';
import { Box, Typography, TextField, Grid,BU } from "@mui/material";
import { styled } from '@mui/system';
import { useFormik } from 'formik';
import { Link } from '@mui/material';
import { GoogleMap, LoadScript } from '@react-google-maps/api';


const Profile = () => {
  // const dispatch = useDispatch();
  // const navigate = useNavigate();
  // const [loading, setLoading] = useState(false);
  // const users = useSelector((state) => state.getuser?.getusers);

  const [name, setname] = useState("");
  const [username, setusername] = useState("");
  const [email, setEmail] = useState("");
  const [interest, setInterest] = useState("");
  const [location, setLocation] = useState("");
  const [billingInfo, setBillingInfo] = useState("");
  const StyledTypography = styled(Typography)({
    textTransform: 'uppercase',
    textAlign: 'center',
    marginBottom: 5,
  });

  const StyledButton = styled(Button)({
    width: '100%',
    marginTop: '1rem',
  });


  const {
    values,
    errors,
    touched,
    handleChange,
    handleSubmit,
    handleBlur,
  } = useFormik({
    initialValues: {
      name: '',
      username: '',
      email: '',
      interest: '',
      location: '',
      billingInfo: '',
    },
    // validationSchema: crudopeUser,
    onSubmit: async (values) => {
  //     const [username, setusername] = useState("");
  // const [email, setEmail] = useState("");
  // const [password, setpassword] = useState("");
  // const [rePassword, setrePassword] = useState("");
  // const dispatch = useDispatch();
  //     e.preventDefault();
  //     if (password !== rePassword) {
  //       toast.error("Password does not match");
  //     } else {
  //       signup(dispatch, { username, email, password });
  //       setusername("");
  //       setEmail("");
  //       setpassword("");
  //       setrePassword("");
  //       redirect("/signup")
  //     }
    },
  });

  return (
    <Box
    sx={{
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      minHeight: '100vh',
      backgroundImage: "linear-gradient(to right, rgba(132, 250, 176, 0.5), rgba(143, 211, 244, 0.5))",
    }}
  >
    <Box sx={{ width: '100%', maxWidth: 550, backgroundColor: 'white', padding: '2rem', margin: ".5rem", borderRadius: '15px' }}>
      <Typography variant="h4" sx={{ mb: 2 }}>Profile</Typography>
      <form onSubmit={handleSubmit}>
        <Grid container spacing={2}>
          <Grid item xs={12} sm={6}>
            <TextField
              fullWidth
              label="Name"
              variant="outlined"
              value={values.name}
              onChange={handleChange}
              onBlur={handleBlur}
              error={errors.name && touched.name}
              helperText={errors.name && touched.name && errors.name}
              id="name"
              name="name"
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <TextField
              fullWidth
              label="Username"
              variant="outlined"
              value={values.username}
              onChange={handleChange}
              onBlur={handleBlur}
              error={errors.username && touched.username}
              helperText={errors.username && touched.username && errors.username}
              id="username"
              name="username"
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <TextField
              fullWidth
              label="Email"
              variant="outlined"
              value={values.email}
              onChange={handleChange}
              onBlur={handleBlur}
              error={errors.email && touched.email}
              helperText={errors.email && touched.email && errors.email}
              id="email"
              name="email"
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <TextField
              fullWidth
              label="Interests"
              variant="outlined"
              value={values.interests}
              onChange={handleChange}
              onBlur={handleBlur}
              error={errors.interests && touched.interests}
              helperText={errors.interests && touched.interests && errors.interests}
              id="interests"
              name="interests"
            />
          </Grid>
          <Grid item xs={12}>
            <TextField
              fullWidth
              label="Location"
              variant="outlined"
              value={values.location}
              onChange={handleChange}
              onBlur={handleBlur}
              error={errors.location && touched.location}
              helperText={errors.location && touched.location && errors.location}
              id="location"
              name="location"
            />
          </Grid>
          <Grid item xs={12}>
            <TextField
              fullWidth
              label="Billing Info"
              variant="outlined"
              value={values.billingInfo}
              onChange={handleChange}
              onBlur={handleBlur}
              error={errors.billingInfo && touched.billingInfo}
              helperText={errors.billingInfo && touched.billingInfo && errors.billingInfo}
              id="billingInfo"
              name="billingInfo"
            />
          </Grid>
        </Grid>
      </form>
    </Box>
  </Box>
  );
};

export default Profile;
